import { Layout } from "antd";
import React from "react";

const { Footer } = Layout;

const FooterComponent: React.FC = () => {
  return (
    <Footer
      style={{
        textAlign: "center",
        padding: "12px 50px",
        backgroundColor: "#f0f2f5",
        height: "auto",
        position: "sticky",
        bottom: 0,
        zIndex: 1,
        width: "100%",
        borderTop: "1px solid #e8e8e8",
      }}
    >
      React Admin Dashboard ©{new Date().getFullYear()} Created with Ant Design
    </Footer>
  );
};

export default FooterComponent;
